import React from "react";

const Footer = () => {
  const styles = {
    img: {
      width: "367px",
    },
    container: {
      background: "#1A1A1A",
    },
  };
  return (
    <div style={styles.container}>
      <div className="row">
        <div className="col">
          <img src="/assets/images/logo.png" style={styles.img} />
        </div>
      </div>
      <hr />
    </div>
  );
};

export default Footer;
